function definitionsFromContext(n){return n.keys().map((function(e){return definitionForModuleWithContextAndKey(n,e)})).filter((function(n){return n}))}function definitionForModuleWithContextAndKey(n,e){var t=identifierForContextKey(e);if(t)return definitionForModuleAndIdentifier(n(e),t)}function definitionForModuleAndIdentifier(n,e){var t=n.default;if("function"==typeof t)return{identifier:e,controllerConstructor:t}}function identifierForContextKey(n){var e=(n.match(/^(?:\.\/)?(.+)(?:[_-]controller\..+?)$/)||[])[1];if(e)return e.replace(/_/g,"-").replace(/\//g,"--")}export{definitionsFromContext,identifierForContextKey};

